  false,\n\t\"url\": null,\n\t\"notes\": \"The Family Investment Program (FIP) is
  Iowa's Temporary Assistance to Needy Families (TANF) program. FIP provides cash
  assistance to needy families, as they become self-supporting so children may be
  cared for in their own homes or in the homes of relatives.  Data are provided on
  the number of cases (families) served, the number of recipients served and the dollar
  value of the payments provided summed by month and county starting January 2011
  and updated monthly. A case is defined as a family group who receives FIP assistance
  together. A recipient is an individual on a FIP case.\",\n\t\"license_title\": \"License
